import Navbar from "./Navbar"
import { store } from "../../features/store"
import { useSelector } from "react-redux"
import Departament from "./Departament"
import ComunitateManagement from "./ComunitateManagement"

function ComunitatiList(){
    let comunitati = []
    comunitati.push('Econosofia')
    comunitati.push('Business Club')
    comunitati.push('Leadership Development')
    comunitati.push('International Affairs')

    return(
        <>
            <h1>Selecteaza un departament</h1>
            <div>
                {comunitati.map((item) => {
                return <ComunitateManagement key={comunitati.indexOf(item)} name={item} />
                })}
            </div>
        </>
    )
}

export default ComunitatiList
